export default class Weather extends Component{
    constructor(){
        super();
        this.state={
            weather:"Not yet gotten"
        }
    }
    render(){
        return (
            <div>
                <button>Get Weather</button>
                <h1>The Weather in Toronto is: {this.state.weather}</h1>
            </div>
        );
    }
}
